    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Edwin B. Forsythe NWR for the next 15 years.
    This plan outlines the Refuge vision and purpose and describes how Edwin B. Forsythe
    NWR will contribute to the overall mission of the Refuge System. The plan provides
    an introduction to the Refuge, an overview of the CCP process, information on the
    Refuge environment and the management direction, and strategies for plan implementation.
    Key planning issues include: habitat and wildlife management, control of invasive
    species, hunting, management of public uses, resource protection, and infrastructure.",nt"license_title":
